/*----------------------------------------------------------------------
 *
 * SET: irreversible commit
 *
 *---------------------------------------------------------------------*/
/**
 * @internal
 * commit irreversible actions
 */
int
_mfd_wmanIfBsProvisionedSfTable_irreversible_commit(netsnmp_mib_handler
                                                    *handler,
                                                    netsnmp_handler_registration
                                                    *reginfo,
                                                    netsnmp_agent_request_info
                                                    *agtreq_info,
                                                    netsnmp_request_info
                                                    *requests)
{
    wmanIfBsProvisionedSfTable_rowreq_ctx *rowreq_ctx =
        netsnmp_container_table_row_extract(requests);

    DEBUGMSGTL(("internal:wmanIfBsProvisionedSfTable:_mfd_wmanIfBsProvisionedSfTable_irreversible:commit", "called\n"));

    netsnmp_assert(NULL != rowreq_ctx);

    /*
     * check for and handle row creation/deletion
     * and update column exist flags...
     */
    if (rowreq_ctx->rowreq_flags & MFD_ROW_DELETED) {
        if (!(rowreq_ctx->rowreq_flags & MFD_ROW_CREATED))
            CONTAINER_REMOVE(wmanIfBsProvisionedSfTable_if_ctx.container,
                             rowreq_ctx);
    } else {
        if (rowreq_ctx->column_set_flags) {
            rowreq_ctx->column_set_flags = 0;
        }
        if (rowreq_ctx->rowreq_flags & MFD_ROW_CREATED) {
            rowreq_ctx->rowreq_flags &= ~MFD_ROW_CREATED;
            CONTAINER_INSERT(wmanIfBsProvisionedSfTable_if_ctx.container,
                             rowreq_ctx);
        }
    }

    return SNMP_ERR_NOERROR;
}                               /* _mfd_wmanIfBsProvisionedSfTable_irreversible_commit */

